INSERT INTO `modovi` VALUES (20,'/home/gamefiles/samp','Roleplay','Roleplay tip igre je simulacija pravog zivota. Ponasanje prema pravilima koja vaze i u pravome zivotu, strpljenje, druzenje, zabava, ali i obaveze koje trazi taj tip igre.','2','./samp03svr &amp;',0,'Los Santos','5|0.05|3.2|0.30|0.08'),(51,'/home/gamefiles/mc','Spigot','','3','java -d64 -Xincgc -Xms1024M -Xmx1024M -XX:MaxPermSize=128M -XX:+DisableExplicitGC -XX:+AggressiveOpts -Dfile.encoding=UTF-8 -jar spigot.jar',0,'world','25|0.25|13.40|1.90|0.468'),(58,'/home/gamefiles/pub','Public','Public Mod','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','||||');
