INSERT INTO `obavestenja` VALUES (90,'Counter Strike 1.6 Modovi','Postovani klijenti O-Neon Hosting-a obavjestavamo vas da 1.11.2018 godine ce uspijesno biti 10 razno raznih modova uploadano na masine i adaptirani da mozete koristiti raznorasne modove po vasem izboru :)<br />\r\n<br />\r\nOstanie snama jer vase povjerenje je nas opstanak.<br />\r\n<br />\r\nVas O-Neon Hosting<br />\r\n<br />\r\nwww.o-neon.info','1538935417',1),(88,'Prvi mjesec ponovnog rada','Povodom prvog mjeseca ponovnog rada O-NEON HOSTINGA sve na≈°e usluge ƒáe biti na akcijskoj cijeni, ukljuƒçujuƒái VPS SSD i HDD Servere, za informacije nam se mozete obratiti putem Facebook stranice ili putem klijent panela ! Jedna od akcijskih usluga ce vam biti postavljena dolje.<br />\r\n<br />\r\n<br />\r\n2 Gigabajta RAM Memorije <br />\r\n1 Core¬†Intel Processor <br />\r\n80 Gigabajta HDD Prostora<br />\r\n10 Terabajta BANDWIDTH-a ~&gt; ZA SAMO 4‚Ç¨ <br />\r\n<br />\r\nhttps://www.o-neon.info','1536114974',1),(87,'SMS Placanje','O-NEON HOSTING je uveo placanje putem SMS-a, za razliku od drugih hostera cijene nasih usluga su jednake putem svakog servisa !<br />\r\n<br />\r\nUsluge koje hostujemo vezane za game sekciju mozete vidjeti putem nase stranice, a cijene ostalih usluga koje imamo u ponudi mo≈æete vidjeti putem https://client.o-neon.info !<br />\r\n<br />\r\npowered by https://o-neon.info','1535788117',1);
