','Sigurnosni Kod','Koji mi je Sigurnosni Kod? Ne mogu da nadjem na Gmail-u\r\n',0,0,'0000-00-00'),(7549,NULL,3906,7460,'0',1,1,'02.09.22, 14-09-2018','POMOC','Zasto kada ubacim mod i kada udjem na srw nece da mi izadje register nego mi pise samo Spawn i one dve strelice?\r\n2 moda sam menjao i opet mi tako \r\n',0,0,'0000-00-00'),(7550,NULL,3907,7459,'2',1,1,'06.09.17, 14-09-2018','pomoc u vezi samp servera','Ovako, otvaramo Yugoslavia RP community, potrebno je da namjestite sat po balkanu jer nam kasni 4sata.',0,0,'0000-00-00'),(7551,NULL,3915,7468,'2',1,1,'06.09.04, 15-09-2018','Pomoc','Moze Mi Neko Srw Prebaciti Na Bukkit Posto Spigot plugini Baguju i pola ne rade ',0,0,'0000-00-00'),(7552,NULL,3915,7468,'3',1,1,'11.09.31, 16-09-2018','Ne Radi Spigot Mod','Ne radi vam Spigot Mod Pola plugina koje ubacis ne rade ako neko moze da prebaci moj srw na bukkit 1.8 ili 1.8.8',0,0,'0000-00-00'),(7553,NULL,3906,7460,'3',1,1,'01.09.35, 16-09-2018','Forum','Jer moze te da nam napravi te Forum za Community HITNO JE !!! \r\nName: [ONG:RP] O-Neon Gaming RolePlay ',0,0,'0000-00-00'),(7554,NULL,3890,7451,'0',1,1,'01.09.40, 17-09-2018','pao mi server','pao mi server ne reaguje na nista',0,0,'0000-00-00'),(7555,NULL,3915,7468,'3',1,1,'10.09.21, 17-09-2018','POMOC','MOLIM NEKOG DA POPRAVI MINECRAFT UBACIO SAM 30 PLUGINA OCITA SAMO 2.3 PLUGINA PROBAO SAM I SAMO ESSENTIALS NECE NITI 1 DA PRIMI MOLIM VAS RIJESITE TO NEKAKO DZABE SRW STOLJI NMG GA PRAVITI BEZ PLUGINA DO HOSTA JE 100% POKUSAO SAM SVE ',0,0,'0000-00-00'),(7556,NULL,3936,7451,'3',1,1,'04.09.19, 18-09-2018','Pomoc','Pozdrav,server iz nekoga razloga ne radi u konzoli nista ne pise...Sve je ubaceno kako treba i provereno 2x,Ako moze neko da pomogne i da resi ukazani problem\r\nHvala <img src=\"./img/smile/001.png\" style=\"width:auto;height:auto;\"/>',0,0,'0000-00-00'),(7557,NULL,3875,7434,'2',1,1,'06.09.07, 19-09-2018','Hitnoo','Ubacen mod i itd al neceee da radi\r\n',0,0,'0000-00-00'),(7558,NULL,3928,7451,'3',1,1,'11.09.51, 20-09-2018','Za zlatana','Zlatan',0,0,'0000-00-00'),(7575,NULL,4071,7537,'3',1,1,'03.10.18, 11-10-2018','Serveri','Postovani,\r\nGde su mi nestali minecraft serveri i kada ce biti vraceni?\r\nAko nije problem instalirajte mi odmah svih 5.\r\nSrdacan pozdrav!',0,0,'0000-00-00'),(7560,NULL,3971,7451,'3',1,1,'02.09.48, 22-09-2018','pao server','ljudi daj vidite resite svi ini fajlovi prazni\r\n i plus ssh mi salje kao gresku za restart\r\nnista nije dirano odjednom je od 9 h ne radi\r\ndaj resite to\r\nlep pozdrav',0,0,'0000-00-00'),(7561,NULL,3971,7451,'0',1,1,'09.09.25, 22-09-2018','ljudiiiiii','opet mi pao ftp koji je **rac vise. nemam nista sad\r\n',0,0,'0000-00-00'),(7562,NULL,3985,7451,'0',1,1,'09.09.59, 24-09-2018','iskljucivo za zlaju','https<img src=\"./img/smile/007.png\" style=\"width:auto;height:auto;\"/>/l.facebook.com/l.php?u=https%3A%2F%2Fwww.sendspace.com%2Ffile%2Fy40t1p&amp;h=AT28SMU_S3Gcmt_N9Fau7jbpFWEqfBpOly4uBQJS8lzWO0M-gQDhEYv5eFHt5vEh6n0nRpws6IFSx34EobBtT1ajnxBxFP14BJjgT1sTVpz8uWRTq6szpLA4iF4IAA4DW3tbIg',0,0,'0000-00-00'),(7563,NULL,3985,7451,'3',1,1,'10.09.52, 27-09-2018','a u ljudi','momci opet ssh i opet nemam nista sve pobrisano.ko koga  ovde  ili neko vas ili vi mene vise blage nemam.dojadilo\r\n',0,0,'0000-00-00'),(7576,NULL,3999,7476,'3',1,1,'04.10.14, 11-10-2018','Crkle masine i veliki bug sa hostom','Pozdrav ! Imam problem vec par dana sa mojim samp serverom / panelom.U pitanju je to da se server sam restartuje posle nekog vremena i automatski vrati stari server.cfg / config ... Odnosno server je sinoc bio otkljucan i restartovo se server i vratio stari config i zakljucao ga...Jos jedan problem trenutno imam a to je da ne mogu kontrolisati svoj panel.U sta god kliknem npr..WebFTP ili scriptfiles nece da ucita...vrti mi onaj gore krug na traci i samo pise \\&quot;Stranica ne postoji ili je privremeno nedostupna\\&quot; \\&quot;Prijavite bug\\&quot;...Ako bi mogli to da resite..Vas developer Root mi je vec to bio resio ali se desava opet\r\nSAMP IP : 37.59.250.165:7780',0,0,'0000-00-00'),(7571,NULL,4002,7495,'3',1,1,'05.10.48, 07-10-2018','UDJIII ','aaa',0,0,'0000-00-00'),(7577,NULL,4000,7517,'3',1,1,'11.10.59, 11-10-2018','Problem','Isti problem kao i sinoc ubaciio sam sada drugi mod i ovo je i prvi i zadnji ali kad sam ga ubacio server je open OFFLINE',0,0,'0000-00-00'),(7578,NULL,4000,7517,'3',1,1,'08.10.25, 12-10-2018','Pomoc','Mozete li mi obrisati mod AhloniX ja ne znam sve probavo ako imaju dva moda obrisite oba mlm vas hitnoo',0,0,'0000-00-00'),(7574,NULL,4000,7517,'3',1,1,'10.10.17, 10-10-2018','Problem','Obrisao sam mod u ubacio drugi kada sam taj drugi mod ubacio server mi je uvjek offline sve sam pregledao mod nema viruse ',0,0,'0000-00-00'),(7580,NULL,4126,7569,'3',1,1,'08.10.47, 16-10-2018','Mali problem','Imam mali problem sa Panelom.Kada kliknem na npr..na podesavanja izbaci mi da stranica nije prona√Ñ‚Äòena i nekada izbaci da nije povezano sa FTP i to..ako bi mogli to da resite sa mojim samp serverom..Ip je : 91.134.159.15:7789',0,0,'0000-00-00'),(7581,NULL,4128,7575,'3',1,1,'09.10.00, 19-10-2018','Kenan','Moj server je vazda offline nmg da ga stavim na online..Kliknem start pise offline dzaba optt\r\n',0,0,'0000-00-00'),(7582,NULL,4120,7537,'3',1,1,'12.10.31, 21-10-2018','SSH ','Resite problem sa ssh na masini ovih servera kojih imam.',0,0,'0000-00-00'),(7583,NULL,4120,7537,'3',1,1,'12.10.28, 25-10-2018','NOVI IP','Postovanje, da li mogu da dobijem novi ip za moje mc servere, posto ova masina ne radi.',0,0,'0000-00-00'),(7584,NULL,4136,7582,'0',1,1,'02.10.58, 28-10-2018','Ubacivanje moda','Rekao mi je vlasnik hosta da vam se obratim oko ubacivanja moda. http<img src=\"./img/smile/007.png\" style=\"width:auto;height:auto;\"/>/balkan-samp.com/forum/index.php?topic=111419.0 Zelim ovaj mod. http<img src=\"./img/smile/007.png\" style=\"width:auto;height:auto;\"/>/www.solidfiles.com/v/2Zv65VkreXaVy evo i download link ',0,0,'0000-00-00'),(7585,NULL,4136,7582,'0',1,1,'02.10.27, 30-10-2018','Ne radi mi server','Ne radi mi server. Na ime nence da radi ni start a i WEBFTP je prazan, mod ne mogu da ubacim ni nista. Ako je moguce napravite mi novi server hvala',0,0,'0000-00-00'),(7586,NULL,4149,7594,'3',1,1,'07.11.47, 04-11-2018','Kako da saznam PIN COD','kako da saznam pin cod da mogu promenit ime servera pls pomognite nisam dobio pin cod',0,0,'0000-00-00');
