 11:34'),(41482,7571,7495,NULL,'Server ne radi\r\n','02.10.50, 24-10-2018'),(41483,7584,7582,NULL,'http//balkan-samp.com/forum/index.php?topic=111419.0\r\n \r\nPosle http dodajte 2 tacke, smajli nastaje zato, a dole imate download link. Hvala','03.10.34, 28-10-2018'),(41479,7579,7537,NULL,'Ovo nije u redu, celi dan cekam, a problem niko ne resava!','07.10.29, 15-10-2018'),(41480,7579,0,28,'Zdravo, da li mi mozes objasniti detaljno u cemu je problem. SP','10.16.2018, 17:19'),(41475,7576,NULL,1,'reseno je ','1539266424'),(41476,7575,7537,NULL,'???','05.10.09, 11-10-2018'),(41477,7575,7537,NULL,'U cemu je problem, zasto idalje servera nema?','08.10.36, 11-10-2018'),(41478,7575,7537,NULL,'Na meni je da prijavim, nisam od onih koji bi nesto dirali po masini. Na web ftp otvara masinu.\r\nI ako nije problem da mi od mc servera port :25566 stavite default port 25565 jer mi je potreban zbog domene (dns-a). Hvala unapred.','09.10.28, 11-10-2018');
